import React, { useEffect } from "react";
import CartService from "../services/cart-service";
const Cart = () => {
  let [cartData, setCartData] = useState(null);
  useEffect(() => {
    CartService.getCart()
      .then((data) => {
        setCartData(data);
      })
      .catch((e) => {
        console.log(e);
      });
  }, []);
  return <div>cart.component</div>;
};

export default Cart;
